import React, { Component } from 'react';

class Search extends Component {

  render() {
    return (
      <div id="search-input">
      <input
          id="search-input"
          autoComplete="off"
          type="text"
          placeholder='Search by Location...'
          />
      </div>
    );
  }

}

export default Search;
